ctx.fillRect(0, 0, ctx.canvas.width, ctx.canvas.height);
window.texture = new THREE.CanvasTexture(ctx.canvas);
window.texture.needsUpdate = true;

const initScene = () => { // Init ThreeJS scene
  const scene = new THREE.Scene();
  window.scene = scene;
  const camera = new THREE.PerspectiveCamera( -1, 1, 1, -1, 0.1, 10 );
  camera.position.z = 100;
  const renderer = new THREE.WebGLRenderer();
  renderer.setClearColor( 0xff0000, 0);
  renderer.setSize( window.innerWidth, window.innerHeight );
  document.body.appendChild( renderer.domElement );
  const clock = new THREE.Clock();
  // const geometry = new THREE.BoxGeometry( SIZE, SIZE, SIZE, 1, RESOLUTION, 1 );
  const geometry = new THREE.PlaneGeometry( SIZE, SIZE, RESOLUTION, RESOLUTION );
  const uniforms = {
    u_time: { value: 0.0 },
    u_texture: { value: window.texture,type: 't' }, // float array (vec3)
  }

  const material = new THREE.ShaderMaterial({
    uniforms,
    vertexShader: resources['empty.vert'],
    fragmentShader: resources['lines.frag'],
    // wireframe: true
  });

  const plane = new THREE.Mesh( geometry, material );
  window.plane = plane;
  scene.add( plane );

  onWindowResize();
  window.addEventListener( 'resize', onWindowResize, false );
  let processDt = 0;

  animate();

  function onWindowResize(event) {
    const aspectRatio = window.innerWidth / window.innerHeight;
    let width, height;
    if (aspectRatio >= 1 ) {
      width = 1;
      height = (window.innerHeight / window.innerWidth) * width;
    } else {
      width = aspectRatio;
      height = 1;
    }
    camera.left = -width;
    camera.right = width;
    camera.top = height;
    camera.bottom = -height;
    camera.updateProjectionMatrix();
    renderer.setSize(window.innerWidth, window.innerHeight);
  }
  function animate() {
    uniforms.u_time.value += clock.getDelta();
    // if (processDt < uniforms.u_time.value - 1) {
      // processDt = uniforms.u_time.value;
      // requestAnimationFrame(() => {
        // const texture = process();
        // texture.needsUpdate = true;
      // });
    // }
    requestAnimationFrame(animate);
    renderer.render(scene, camera);
  }
};
const mixVal = 0.5;

const getImageData = (x, y, c = ctx) => {
  x = Math.max(0, x);
  y = Math.max(0, y);

  x = Math.min(x, c.canvas.width - 1);
  y = Math.min(y, c.canvas.height - 1);
  const data = c.getImageData(x, y, 1, 1).data;
  return chroma(data[0], data[1], data[2]);
};

